B.ab_=new A.ba("-Le prime 4 squadre si qualificheranno per le semifinali (1\xaa vs 4\xaa e 2\xaa vs 3\xaa). Successivamente si giocheranno la finale tra i vincenti e la finalina tra i perdenti della fase precedente",null,null,null,null,null,B.Q,null,null,null)
