B.abH=new A.ba("-Non esistono sostituzioni. I 7 giocatori che scendono in campo saranno gli stessi che finiranno la partita",null,null,null,null,null,B.Q,null,null,null)
B.abi=new A.ba("-La quota di partecipazione sar\xe0 di 20\u20ac. Compresa nel prezzo dell'iscrizione ci sar\xe0 anche la maglia ufficiale del torneo che obbligatoriamente deve essere messa ogni partita",null,null,null,null,null,B.Q,null,null,null)
B.aba=new A.ba("-Non saranno tollerati in alcun modo eccessi di foga o insulti pena espulsione diretta (3 minuti fuori dal campo)",null,null,null,null,null,B.Q,null,null,null)
B.abI=new A.ba("-In caso uno o pi\xf9 giocatori dei 7 che si sono iscritti inizialmente non possono partecipare ad una partita, deve essere comunicato il cambio al massimo 24 ore prima dell'inizio del match",null,null,null,null,null,B.Q,null,null,null)
B.abB=new A.ba("-Oltre ai trofei per 1\xb0, 2\xb0 e 3\xb0 posto verranno assegnati al capocannoniere e all'MVP del torneo due trofei personali ",null,null,null,null,null,B.Q,null,null,null)
